import React, { Component } from 'react'
import "../index.css"

export class Q2 extends Component {
    render() {
        return (
            <div >
                <h1 style={{ textAlign: "left", padding: "15px", fontSize: "30px", color: "darkred" }}>Q2: Level 100: </h1>
                <h4 style={{ textAlign: "left", fontweight: "bold", fontSize: "20px" }}>1.	Remove duplicates from an unsorted list (12,11,12,21,41,43,21)</h4>
                <pre>
                    array = [12, 11, 12, 21, 41, 43, 21]
                    def removeDup(array):
                        dic = {}
                        ans = []
                    for ele in array:
                        if ele not in dic.keys():
                            dic[ele] = 1
                            ans.append(ele)
                        else:
                            continue
                    return ans
                    print(removeDup(array))

                </pre>

            </div>
        )
    }
}

export default Q2
